#include <stdio.h>
#include <stdlib.h>
int* twoSum(int* numbers, int numbersSize, int target, int* returnSize) {
	int * index = (int *)malloc(2*sizeof(int));
	*returnSize = 2;
	int left = 0, right = numbersSize - left - 1;
	int tmp = target - numbers[left];
	while(left<right){
		while(numbers[right]>tmp){
			right--;
		}
		if (numbers[right] == tmp)	
		{			
			break;
		}
		tmp = target - numbers[right];
		while(numbers[left]<tmp && left < right){
			left++;
		}
		if (numbers[left] == tmp)	
		{
			break;
		}
		tmp = target - numbers[left];
	}

	index[0] = left+1;
	index[1] = right+1;
	return index;
}

